import React from "react";
import items from "./Items";
import './FoodItem.css'

const FoodItems = () => {
  return (
    <>
      {console.log(items, "jakkaka")}
      <ul  className="item">
        {items?.map((item) => (
          <div key={item.id}>
            <li c>{item?.name}</li>
            <li>{item?.price}</li>
            <li>{item?.origin}</li><hr></hr>
          </div>
        ))}
      </ul>
    </>
  );
};

export default FoodItems;
